	add("wordage", "{\"term\":\"wordage\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|word|age|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Words collectively\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The excessive use of words; verbiage\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1829\u0027\u0027 April, \u0026quot;Article VIII\u0026quot; (review of \u0027The Cause of Dry Rot Discovered\u0027), \u0027The Westminster Review\u0027, [https://books.google.ca/books?id\u003dfPsEAAAAQAAJ\u0026amp;pg\u003dPA417\u0026amp;dq\u003d%22all+the+wordage%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003ddLY2VeXsGcO3yATorYD4CA\u0026amp;ved\u003d0CCIQ6AEwA\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22all%20the%20wordage%22\u0026amp;f\u003dfalse p. 417 (Google books view\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"But the plates are good, and, in reality, sufficient without all the \u0027\u0027wordage\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The number of words used in a text\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1951\u0027\u0027 July 2, \u0026quot;[http://content.time.com/time/magazine/article/0,9171,815037,00.html MacArthur Hearing: Curtain],\u0026quot; \u0027Time\u0027 \u0026lt;small\u0026gt;(retrieved 21 April 2015)\u0026lt;/small\u0026gt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The official transcript totaled 2,045,000 words—more than twice the \u0027\u0027wordage\u0027\u0027 of the Bible\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The choice of words used; phraseology\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027 May 15, Jack Curry, \u0026quot;[http://www.nytimes.com/1990/05/15/sports/winfield-case-heads-to-arbitrator.html Winfield Case Heads to Arbitrator],\u0026quot; \u0027New York Times\u0027 \u0026lt;small\u0026gt;(retrieved 21 April 2015)\u0026lt;/small\u0026gt\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"quot;With the \u0027\u0027wordage\u0027\u0027 in the contract, we think we have a good case.\u0026quot\", \"priority\":11}]}, \"synonyms\":{}}");

	add("wordbuilding", "{\"term\":\"wordbuilding\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\"], \"text\":\"From {{compound|word|building|lang\u003den}}. Compare German \u0027wortbildung\u0027 (word formation, morphology)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The construction of words from simpler units\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"We gave the children a \u0027\u0027wordbuilding\u0027\u0027 exercise\", \"priority\":2}]}, \"synonyms\":{}}");

