	add("wordmark", "{\"term\":\"wordmark\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|word|mark|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A logotype; a standardized graphic representation of the name of a company or product used for purposes of easy identification. It is is often text with unique typographic treatments. Usually the company name is incorporated together with simple graphic treatments, so that the representation of the word essentially becomes a symbol of the company\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A bit in each memory location on some variable-word-length computers (e.g. , ) used to mark the end of a word\", \"priority\":2}]}, \"synonyms\":{}}");

	add("wordness", "{\"term\":\"wordness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|word|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being a word or words\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"w:Charles Charles Bernstein, “Three or Four Things I Know about Him” (essay), in \u0027Content’s Dream: Essays 1975–1984\u0027, Northwestern University Press (2001), ISBN 9780810118454, [http://books.google.com/books?id\u003d5R-LUVdxeK0C\u0026amp;pg\u003dPA32\u0026amp;dq\u003dwordness page 32\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The move from purely descriptive, outward directive, writing toward writing centered on its \u0027\u0027wordness\u0027\u0027, its physicality, its haecceity (thisness) is, in its impulse, an investigation of human self-sameness\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027, Gaurinath Bhattacharyya Shastri, \u0027A study in the dialectics of Sphoṭa\u0027, page 11\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Now, \u0027\u0027word-ness\u0027\u0027 pertains to all words and is, therefore, regarded as a class (jati) and, so, it is said to be eternal\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1988–1989\u0027\u0027, \u0027Brain and reading: structural and functional anomalies in developmental dyslexia with special reference to hemispheric interactions, memory functions, linguistic processes, and visual analysis in reading : proceedings of the 7th International Rodin Remediation Conference at the Wenner-Gren Center, Stockholm and Uppsala University, June 19-22, 1988\u0027, page 89\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Accuracy revealed a classic overall RVFA, an overall advantage of words over nonwords and an overall \u0027\u0027wordness\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Ulla E. Dydo, \u0027A w:Gertrude Stein Reader\u0027, Northwestern University Press, ISBN 978-0-8101-1083-0, [http://books.google.com/books?id\u003dcvZaz7pPKBwC\u0026amp;pg\u003dPA314\u0026amp;dq\u003dwordness page 314\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Here for once she even includes a word butchered of its \u0027\u0027wordness\u0027\u0027 to make possible the dreadful rhyme “trois/wha.”\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Fran Zaidel, \u0026quot;Interhemispheric Transfer in the Split Brain: Long-term Status Following Complete Cerebral Commissurotomy\u0026quot;, chapter 17 of Richard J. Davidson and Kenneth Hugdahl (editors), \u0027Brain Asymmetry\u0027, MIT Press (1998), ISBN 978-0-262-54079-7, [http://books.google.com/books?id\u003d1G6p80GQnOUC\u0026amp;pg\u003dPA492\u0026amp;dq\u003dwordness page 492\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"some independent stimulus variable (e.g., \u0027\u0027Wordness\u0027\u0027 [words, nonwords] in a lexical decision task or Decision [global, local] in a hierarchic perception task\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, José J. Cañas and María Teresa Bajo, \u0027Automatic and Strategic Processes in Lexical Access\u0027, in \u0027Language processing in Spanish\u0027, edited by Manuel Carreiras, José E. García-Albea, Núria Sebastián-Gallés, page 76\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"For example, it is possible that when many strong targets are introduced in the list, only strong relations are taken as evidence of \u0027\u0027wordness\u0027\u0027, whereas when many related pairs are included, both weak and strong relations would be taken as evidence of \u0027\u0027wordness\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Zvia Breznitz, \u0027Brain research in language\u0027, page 165\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"McLaughlin, Osterhout, and Kim (2004), for example, used the known sensitivity of the N400 to semantic relationships and lexicality (or \u0027\u0027wordness\u0027\u0027 – the property of a string of letters representing an actual word\", \"priority\":15}]}, \"synonyms\":{}}");

	add("wordnet", "{\"term\":\"wordnet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|word|net|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A semantically structured lexical database\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Cvetana Krstev, \u0026quot;Corpora Issues in Validation of Serbian Wordnet\u0026quot;, in Václav Matoušek, Pavel Mautner, eds., \u0027Text, Speech and Dialogue: 6th International Conference, TSD 2003, České\u0027, page 13\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Bilingual corpora can be used for synset validation in a more fruitful way, especially having in mind the request that all synsets from a \u0027\u0027wordnet\u0027\u0027 for a language other than English have to be associated, if possible, with an English synset using ILI\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Helge Dyvik, \u0026quot;Translations as Semantic Mirrors: from parallel corpus to wordnet\u0026quot;, in Karin Aijmer, Bengt Altenberg, eds., \u0027Advances in Corpus Linguistics: Papers from the 23rd International\u0027, page 31\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"if a document mentions dogs, a \u0027\u0027wordnet\u0027\u0027 allows the inference it is about animals\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Paul Buitelaar \u0027et al\u0027., \u0026quot;Domain-Specific WSD\u0026quot;, in Eneko Agirre, Philip Edmonds, eds., \u0027Word Sense Disambiguation: Algorithms And Applications\u0027, page 29\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"This trimmed \u0027\u0027wordnet\u0027\u0027 was used in a cross-retrieval test environment and compared with the generic \u0027\u0027wordnet\u0027\u0027 and no \u0027\u0027wordnet\", \"priority\":7}]}, \"synonyms\":{}}");

	add("wordoid", "{\"term\":\"wordoid\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|word|oid|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fabricated word coined to identify a new concept\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006,\u0027\u0027 David Sims, in \u0027First Coffee for St. Valentine\u0027s Day, 2006\u0027 [http://blog.tmcnet.com/telecom-crm/2006/02/14/first-coffee-for-st-valentines-day-2006.asp\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Well, I guess there\u0027s a new \u0027\u0027wordoid\u0027\u0027 we all have to endure: infotainment\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006,\u0027\u0027 James A. Stewart, in \u0027Laurel And Hardy\u0027 movie review [http://www.dvdverdict.com/reviews/laurelhardycol.php\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"As Leonard Maltin notes in commentary, a more modern character appropriated that little \u0027\u0027wordoid\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005,\u0027\u0027 Pyramus, in \u0027Little or Nothing\u0027 [http://cephalogenic.blogspot.com/2005/08/little-or-nothing.html\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I can\u0027t get away from the word, or \u0027\u0027wordoid\u0027\u0027, \u0026quot;miniscule\u0026quot\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2003,\u0027\u0027 Daniel J. Stern, in \u0027rec.autos.tech\u0027 [http://groups.google.com/group/rec.autos.tech/msg/6266d1cea8dd61ba\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"quot;Gage\u0026quot;, like \u0026quot;flammable\u0026quot;, is a fabricated \u0027\u0027wordoid\u0027\u0027 created on the assumption, not entirely without merit, that people are too stupid to read, understand and pronounce the properly-spelled word (\u0026quot;inflammable\u0026quot;, in the latter case\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2003,\u0027\u0027 Eirik Johnson, in \u0027A New Twist on Noise\u0027 [http://linux.depaul.edu/archive/depaul-lug/2003-03/msg00309.html\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Meantime, virii is a perfectly good \u0027\u0027wordoid\u0027\u0027, that\u0027s right, \u0027\u0027wordoid\u0027\u0027. It isn\u0027t a word, it just resembles one closely enough that nobody cares\", \"priority\":11}]}, \"synonyms\":{}}");

	add("wordsmith", "{\"term\":\"wordsmith\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|word|smith|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who uses words skillfully\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"She has always been known as a capable \u0027\u0027wordsmith\u0027\u0027, but in this latest novel she also shows surprising emotional depth\", \"priority\":2}]}, \"synonyms\":{}}");

	add("wordstock", "{\"term\":\"wordstock\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|word|stock|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The set of words in a language\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1978\u0027\u0027, Iván Boldizsár, \u0027The New Hungarian Quarterly\u0027 (volume 19, issues 69-70\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Among the English words that were added to the Hungarian \u0027\u0027wordstock\u0027\u0027 at the beginning of the twentieth century, we find many associated with sports, entertainment, fashion, high lif\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Michelle Howard, \u0027Learn Unilingua - The Language for International Communication\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Also, the \u0027\u0027wordstock\u0027\u0027 of Unilingua is considered \u0027a priori\u0027, that is, there is no deliberate association with words or roots in existing natural languages\", \"priority\":5}]}, \"synonyms\":{}}");

