	add("worker", "{\"term\":\"worker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|work}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who performs labor for his living, especially manual labor\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/science-and-technology/21601233-exploring-link-between-manganese-and-parkinsons-disease-subtle-effects Subtle passage\u003dManganism has been known about since the 19th century, when miners exposed to ores containing manganesebegan to totter, slur their speech and behave like someone inebriated. The poisoning was irreversible, and soon ended in psychosis and death. Nowadays \u0027\u0027workers\u0027\u0027 are exposed to far lower doses and manganism is rare\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A nonreproductive social insect, such as ant, bee, termite or wasp\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A female ant, bee, termite or wasp\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A thread performing one instance of a particular task within a program\", \"priority\":5}]}, \"synonyms\":{}}");

	add("workgroup", "{\"term\":\"workgroup\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|work|group|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A group of workers engaged in a series of collaborative tasks who usually work together\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A computer network created for use by such groups\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Chris Fehily, \u0027Microsoft Windows Vista‎\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"When you set up a network, Windows creates a \u0027\u0027workgroup\u0027\u0027 and gives it a name automatically\", \"priority\":4}]}, \"synonyms\":{}}");

	add("workhorse", "{\"term\":\"workhorse\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|work|horse|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A horse used primarily for manual labor; a draft hors\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Anyone or anything that does a lot of work; something or someone who works consistently or regularly\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Those old machines are not very glamorous, but even 20 years after their introduction, they are still the \u0027\u0027workhorses\u0027\u0027 of the industry\", \"priority\":3}]}, \"synonyms\":{}}");

