	add("workmanship", "{\"term\":\"workmanship\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|workman|ship|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The skill of an artisan or craftsman\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The quality of something made by an artisan or craftsman\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Mind you, clothes were clothes in those days. There was a great deal of them, lavish both in material and in \u0027\u0027workmanship\", \"priority\":3}]}, \"synonyms\":{}}");

