	add("workout", "{\"term\":\"workout\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An exercise session; a period of physical exercise\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Jim Montgomery, Mo Chambers, \u0027Mastering Swimming\u0027, page 157\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The following guidelines for smart weekly scheduling can simplify this piece of the planning: Swim three or four \u0027\u0027workouts\u0027\u0027 each week\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A schedule or program of specific exercises, especially one intended to achieve a particular goal\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Peter Twist, \u0027Complete Conditioning for Hockey‎\u0027, page 17\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"If athletes do too much too soon, they will be stiff and sore 24 to 48 hours after a new \u0027\u0027workout\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Mark Alvisi (quote from a reader), \u0026quot;Mark of a Champion\u0026quot;, \u0027Muscular Development‎\u0027 \u0027\u002747\u0027\u0027(1): 35\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I read in another magazine about a \u0027\u0027workout\u0027\u0027 that can put a whole inch on your arms in just one day\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Any activity that requires much physical or mental effort, or produces strain\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Jan Karon, \u0027A Common Life: The Wedding Story\u0027, page 41\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Cynthia\u0027s phone got a \u0027\u0027workout\u0027\u0027, as well. In approximately three days since the news had hit the street, a total of five bridal showers had been booked, not to mention a luncheon at Esther Cunningham\u0027s and tea at Olivia Harper\u0027s\", \"priority\":11}]}, \"synonyms\":{}}");

