	add("wormwood", "{\"term\":\"wormwood\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"middle low german\"], \"text\":\"From Middle english (1100-1500) \u0027wormwode\u0027 alteration of \u0027wermode\u0027 (wormwood) from Old english (ca. 450-1100) {{m|ang|wermōd}}, {{m|ang|wormōd||wormwood, absinthe}}, from Proto-germanic {{m|gem-pro|*wermōdaz||wormwood}}. Cognate with Middle low german \u0027wermode\u0027 \u0027wermede\u0027 (wormwood) German \u0027wermut\u0027 (wormwood) See {{l|en|vermouth}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An intensely bitter herb (\u0027Artemisia absinthium\u0027 and similar plants in genus \u0027Artemisia\u0027) used in the production of absinthe and vermouth, and as a tonic\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"William Shakespeare, \u0027Romeo and Juliet\u0027, Act I, Scene iii \u0027(the nurse\u0027s monologue\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But as I said, / When it did taste the \u0027\u0027wormwood\u0027\u0027 on the nipple / Of my dug and felt it bitter, pretty fool, / To see it tetchy and fall out with the dug\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Anything that causes bitterness or affliction\", \"priority\":4}]}, \"synonyms\":{}}");

	add("worrier", "{\"term\":\"worrier\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|worry|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who worries a great deal, especially unnecessarily\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"You are such a worrier! I\u0027m sure everything will turn out all right\", \"priority\":2}]}, \"synonyms\":{}}");

