	add("worrywart", "{\"term\":\"worrywart\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Attested 1956, I. BELKNAP Human Problems of State Mental Hospitals x. 177\u0026lt;ref\u0026gt;{{R:OED}}\u0026lt;/ref\u0026gt; In cartoon w:Out Our Way|Out Our Way by w:J. R. Williams (cartoonist)|J. R. Williams, there is a character by that name. Earlier examples from newspapers of the 1930s and 1940s.\u0026lt;ref\u0026gt;[http://wordcraft.infopop.cc/eve/forums/a/tpc/f/932607094/m/7671019934 Word Craft Forum: Worry Wort]\u0026lt;/ref\u0026gt;Presumably related to earlier \u0027\u0027 From \u0027\u0027 “wart” apparently chosen for alliteration.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who worries excessively, especially about unimportant matters\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Hal Edward Runkel, \u0027Screamfree Parenting: Raising Your Kids by Keeping Your Cool\u0027\u0026lt;!--ISBN 0975998110--\u0026gt;, page 31\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It doesn\u0027t mean you\u0027re a \u0027\u0027worrywart\u0027\u0027, a nervous wreck or in need of heavy medication\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Nicole L.V. Mullis, \u0026quot;[http://www.battlecreekenquirer.com/apps/pbcs.dll/article?AID\u003d/20080817/NEWS01/808170302/1002/NEWS01 Vacation renders kids, adult males impervious to danger]\u0026quot;, \u0027Battle Creek Enquirer\u0027 online, August 17\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"On vacation, I\u0027m a \u0027\u0027worrywart\u0027\u0027 for fretting about third-degree burns and puncture wounds\", \"priority\":5}]}, \"synonyms\":{}}");

