	add("worshipability", "{\"term\":\"worshipability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|worship|ability|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Capability of being worshiped; worthiness of veneration\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1836\u0027\u0027, w:Samuel Taylor Samuel Taylor Coleridge, \u0027The Literary Remains of Samuel Taylor Coleridge\u0027, Volume 1, [http://books.google.ca/books?id\u003dXA8LAAAAYAAJ\u0026amp;pg\u003dPA378\u0026amp;dq\u003d%22worshipability%22\u0026amp;hl\u003den\u0026amp;ei\u003dqQ4_TqmxNOqqsALEouUB\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d5\u0026amp;ved\u003d0CDwQ6AEwB\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22worshipability%20of%22\u0026amp;f\u003dfalse p. 378\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I commend the modern Unitarians for their candour in giving up the possible \u0027\u0027worshipability\u0027\u0027 of Christ, if not very God\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, w:Norman L. Norman L. Geisler, \u0027Christian Apologetics\u0027, ISBN 9780801038228, [http://books.google.ca/books?ei\u003drRA_TuH2LeLisQLSnek2\u0026amp;ct\u003dresult\u0026amp;id\u003dP4bWAAAAMAAJ\u0026amp;dq\u003d%22worshipability%22\u0026amp;q\u003d%22lack+worshipability%2\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"search_anchor p. 186\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A God who is totally and completely Other lacks relatability and no doubt, at least to many, he will lack \u0027\u0027worshipability\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, David Lamont Paulsen and Donald W. Musser, \u0027Mormonism in Dialogue with Contemporary Christian Theologies\u0027, ISBN 9780881460834, [http://books.google.ca/books?id\u003df4aYe_EbAQAC\u0026amp;dq\u003d%22worshipability%22\u0026amp;q\u003d%22worshipability.%2\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003dsnippet\u0026amp;q\u003d%22worshipability.%22\u0026amp;f\u003dfalse p. 530\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Critics of the openness model are quick to contend that any qualification of the notion of God\u0027s complete knowledge of the future diminishes his power and \u0027\u0027worshipability\", \"priority\":10}]}, \"synonyms\":{}}");

	add("wortcraft", "{\"term\":\"wortcraft\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|wort|craft|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Knowledge of the) medical usage of worts, of herbal remedies (and related magic); herblore\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027 Tony Linsell, \u0027Anglo-Saxon Mythology, Migration \u0026amp; Magic\u0027 (ISBN 1-898281-09-2\u0027), page 16\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They were the keepers of starcraft, runecraft, lorecraft and \u0027\u0027wortcraft\u0027\u0027 and they guided many through the darkness of the future and healed bodies and minds\", \"priority\":3}]}, \"synonyms\":{}}");

	add("worthlessness", "{\"term\":\"worthlessness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|worthless|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of lacking worth, of being valueless, useless or devoid of benefit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1905\u0027\u0027 \u0027This sort of fat instead of indicating health points to disease. This general teaching as to the \u0027\u0027worthlessness\u0027\u0027 of alcohol as a food had been set forth by the leaders in medical profession, and accepted largely by the rank and file of practitioners for about twenty-five years.\u0027 — Carry Nation, \u0027The Use and Need of the Life of Carry A. Nation\u0027, [http://etext.virginia.edu/etcbin/ot2www-pubeng?specfile\u003d/texts/english/modeng/publicsearch/modengpub.o2w\u0026amp;act\u003dsurround\u0026amp;offset\u003d502062211\u0026amp;tag\u003dNation,+Carry+A.:+The+Use+and+Need+of+the+Life+of+Carry+A.+Nation,+1905\u0026amp;query\u003dworthlessness\u0026amp;id\u003dNatUsea Chapter 28\", \"priority\":2}]}, \"synonyms\":{}}");

	add("worthliness", "{\"term\":\"worthliness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|worthly|ness|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being worthly; valuableness; importance; stateliness; dignity; worthiness; excellence\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1862\u0027\u0027, Robert Vaughan, Henry Allon, \u0027The British quarterly review\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"We confess it appears to us that knowledge of character, quick perception into the worth or \u0027\u0027worthliness\u0027\u0027 of those about us, in no degree depends on, or can be governed by, any system or theory whatever\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1909\u0027\u0027, The Medical standard\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Some undergraduates will advance while some graduates will retreat, so that in the end their \u0027\u0027worthliness\u0027\u0027 may be cancelled in parallel lines\", \"priority\":5}]}, \"synonyms\":{}}");

	add("worthwhileness", "{\"term\":\"worthwhileness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|worthwhile|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being worthwhile\", \"priority\":1}]}, \"synonyms\":{}}");

	add("wortlore", "{\"term\":\"wortlore\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|wort|lore|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The knowledge of plants, herbs, and worts; botany\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Henry A. Bright, \u0027A Year in a Lancashire Garden - Page 6\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They will come up each year from between the Rhododendrons, and will send their sweet subtle odour through the open windows into the house. And as I write I am told of a recipe showing how, in the \u0027\u0027Wortlore\u0027\u0027 of old, the firm white petals were esteemed of use\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Suzanne Ruthven, ‎Melusine Draco, \u0027Shaman Pathways - Black Horse, White Horse\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"This may often have been the case in many instances of horse whispering tricks, but the interview with former race-horse trainer, Paul Harriss, for Alphard magazine reveals that there is more to the true whisperer than mere tricks and \u0027\u0027wortlore\u0027\u0027: \", \"priority\":5}]}, \"synonyms\":{}}");

